import React, { useState } from "react";
import './navigation-panel.scss';
import { Link } from "react-router-dom";
import MenuIcon from '@mui/icons-material/Menu';
import KeyboardArrowLeftIcon from '@mui/icons-material/KeyboardArrowLeft';
import Divider from '@mui/material/Divider';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import PeopleIcon from '@mui/icons-material/People';
import PowerSettingsNewIcon from '@mui/icons-material/PowerSettingsNew';
import DisplaySettingsIcon from '@mui/icons-material/DisplaySettings';
import LanguageIcon from '@mui/icons-material/Language';
import DashboardIcon from '@mui/icons-material/Dashboard';
import DeviceHubIcon from '@mui/icons-material/DeviceHub';
import HubIcon from '@mui/icons-material/Hub';

function Navigation() {

    const [navList, setNavlist] = useState(false);
    const showNavlist = () => setNavlist(!navList);
    const iconsMain = [
        <DashboardIcon/>,
        <DeviceHubIcon/> ,
        <HubIcon/>,
        <PeopleIcon/>,
      ];
    const iconsConfig = [
        <DisplaySettingsIcon/>,
        <LanguageIcon/> ,
        <PowerSettingsNewIcon/>,
        <PeopleIcon/>,
      ];

    return (
        <div className={navList ? 'navlist active' : 'navlist'}>
            <div id="hamburger" className="hamburger" type="button" onClick={showNavlist}>
                {navList? <KeyboardArrowLeftIcon sx={{position: 'absolute', top: '20px', right: '20px' }} /> : <MenuIcon sx={{ fontSize: 30,position: 'absolute', right: '-50px'}} />}
            </div>

            <ul id='nav-list' onClick={showNavlist}>
                <Link className="nav-panel-link" to='/'><li>
                    <span class="nav-text">
                        Dashboard
                    </span>
                </li></Link>

                <Link className="nav-panel-link" to='/fleet'><li>
                    <span class="nav-text">
                        Fleets
                    </span>
                </li></Link>

                <Link className="nav-panel-link" to='/cluster'><li>
                    <span class="nav-text">
                        Clusters
                    </span>
                </li></Link>

                <Link className="nav-panel-link" to='/cluster'><li>
                    <span class="nav-text">
                        Users
                    </span>
                </li></Link>

                <Divider />

                <List>
        {['Configuration', 'Preferences', 'Logout'].map((text, index) => (
          <ListItem key={text} disablePadding>
            <ListItemButton>
              <ListItemIcon>
                {iconsConfig[index] }
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
            </ul>
        </div>
    );
}

export default Navigation;
